import React, { Component } from "react";

export class DataTable extends Component {
    state
  render() {
    return (
      <table>
        <tr>
          <th>Name</th>
          <th>Age</th>
          <th>Eye color</th>
          <th>Gender</th>
          <th>Company</th>
          <th>Email</th>
          <th>Phone</th>
          <th>Address</th>
        </tr>

      </table>
    );
  }
}

export default DataTable;
